import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div key="twit">
          짹짹
          <br />0
        </div>,
        <div key="follwings">
          팔로잉
          <br />0
        </div>,
        <div key="follwer">
          팔로워
          <br />0
        </div>
      ]}>
      <Card.Meta avatar={<Avatar>Di</Avatar>} title="Di" />
    </Card>
  );
};

export default UserProfile;
